import { Component } from '@angular/core';

interface DongHo {
  name: string;
}

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  dongho: DongHo[] = [
    { name: 'Casio G-Shock' },
    { name: 'Seiko SKX007' },
    { name: 'Timex Weekender' },
    { name: 'Citizen Eco-Drive' },
    { name: 'Rolex Submariner' }
  ];

  selectedDongHo: DongHo | null = null;

  onSelect(dongho: DongHo): void {
    this.selectedDongHo = dongho;
  }
}
